import React from 'react'
import Video  from "./Video";
const VideoGrid = () => {
    const images = [1,3,5,7];

    return (
        <div className="ml-2 mr-2">

        {images.map(img => (
            <div className="music-grid-left mb-2">
                <Video key={img} video={img} big={true} />
                <Video key={img+1} video={img+1} big={false} />
            </div>
        ))}

        </div>
    )
}

export default VideoGrid
